Service Consumer (1..1)
Transaction Identifier (0..1) {this is this transaction identifier, e.g. the TRN of the online form}
Lodgement Date (1..1)
Client Details (0..1)
-	The client identifier (CID) of the client being updated (1..1)
-	Trading Name (0..1)
-	Business address (0..1)
-	Annual turnover amount (0..1)
-	Annual turnover range (0..1)
-	Evidence Checklist (0..1) {same as vsa:modifyVisaApplicantEvidenceInformationListType}
Application Details (0..1) 
-	The Sponsorship Identifier (TRN or ICSE Application ID) of the sponsorship being updated (1..1)
-	Ongoing communications contact details (0..1) {same attributes as in vsa:registerVisaApplicationContactRecipientDetails}
-	Owners / Directors / Principals / Partners details (0..N) {same attributes as in vsa:registerVisaApplicationContactRecipientDetails}
Lodging User Details (0..1) {same as vsa:registerVisaApplicationLodgingUserType}

request.response_payload_text:
A GetCheckResultResponse SOAP xml message
The "GetCheckResultResponse" message will contain one of the following elements:
1. A "CheckStatusResult" will contain either an Interim Check Result or Final Check result;
2. A "CheckSubmitResponse" will contain a Check Submit Response indicating either an NSS validation failure or notification of a duplicate submission;
3. A "ServiceNotification" which is an informational message indicating that there is no message available for retrieval

